<!DOCTYPE html>
<html lang="fr">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>L'Aventure Glac√©e de Naya avec Elsa</title>
    <link href="https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;700;800&display=swap" rel="stylesheet">
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body {
            font-family: 'Nunito', sans-serif;
            background: linear-gradient(135deg, #1a1a4e 0%, #2d1b69 50%, #0d3b66 100%);
            min-height: 100vh;
            overflow-x: hidden;
        }
        .decorations { position: fixed; top: 0; left: 0; width: 100%; height: 100%; pointer-events: none; z-index: 0; }
        .floating-element { position: absolute; font-size: 28px; animation: floatAnim 4s ease-in-out infinite; opacity: 0.7; }
        @keyframes floatAnim { 0%, 100% { transform: translateY(0) rotate(0deg); } 50% { transform: translateY(-20px) rotate(10deg); } }
        .container { position: relative; z-index: 1; max-width: 900px; margin: 0 auto; padding: 15px; min-height: 100vh; display: flex; flex-direction: column; }
        .title { text-align: center; color: #7dd3fc; font-size: 2.2em; font-weight: 800; text-shadow: 3px 3px 6px rgba(0,0,0,0.5), 0 0 20px rgba(125,211,252,0.4); margin-bottom: 15px; }
        .controls { display: flex; flex-wrap: wrap; justify-content: center; gap: 10px; margin-bottom: 15px; padding: 12px; background: rgba(255,255,255,0.1); border-radius: 15px; backdrop-filter: blur(10px); }
        .control-group { display: flex; align-items: center; gap: 8px; }
        .control-label { color: #fff; font-size: 0.9em; font-weight: 600; }
        button { padding: 10px 18px; font-size: 1em; border: none; border-radius: 20px; cursor: pointer; transition: all 0.3s ease; font-family: 'Nunito', sans-serif; font-weight: 700; }
        .nav-btn { background: linear-gradient(135deg, #38bdf8, #0ea5e9); color: white; box-shadow: 0 3px 10px rgba(56,189,248,0.4); min-width: 100px; }
        .nav-btn:hover:not(:disabled) { transform: translateY(-2px); box-shadow: 0 5px 15px rgba(56,189,248,0.6); }
        .nav-btn:disabled { background: #555; cursor: not-allowed; box-shadow: none; }
        .feature-btn { background: linear-gradient(135deg, #a78bfa, #8b5cf6); color: white; box-shadow: 0 3px 10px rgba(167,139,250,0.4); }
        .feature-btn:hover { transform: translateY(-2px); }
        .zoom-btn { background: linear-gradient(135deg, #22d3d3, #06b6d4); color: white; padding: 10px 14px; font-size: 1.1em; }
        select { padding: 10px 14px; font-size: 0.95em; border: none; border-radius: 20px; background: linear-gradient(135deg, #f472b6, #ec4899); color: white; cursor: pointer; font-family: 'Nunito', sans-serif; font-weight: 600; }
        .page-indicator { text-align: center; color: #fff; font-size: 1.2em; font-weight: 700; margin: 10px 0; text-shadow: 2px 2px 4px rgba(0,0,0,0.5); }
        .book-wrapper { flex: 1; display: flex; justify-content: center; align-items: flex-start; padding: 10px; }
        .book { background: linear-gradient(135deg, #4a6fa5, #5a8ac7, #4a6fa5); border-radius: 15px; box-shadow: 0 15px 50px rgba(0,0,0,0.5), inset 0 0 30px rgba(255,255,255,0.1); padding: 12px; transition: transform 0.3s ease; }
        .page { width: 450px; background: #fff; border-radius: 10px; overflow: hidden; box-shadow: 0 5px 20px rgba(0,0,0,0.2); }
        .page.cover-page { width: 480px; }
        .page-image { width: 100%; height: auto; display: block; cursor: pointer; }
        .page-image:hover { opacity: 0.95; }
        .page-text { padding: 20px; background: linear-gradient(135deg, #e0f2fe, #bae6fd); border-top: 3px solid #38bdf8; min-height: 80px; }
        .story-text { font-size: 1.3em; line-height: 1.8; color: #1e3a5f; text-align: center; font-weight: 700; }
        .page.cover-page .page-text { background: linear-gradient(135deg, #1e3a5f, #2d4a6f); border-top: 3px solid #7dd3fc; }
        .page.cover-page .story-text { color: #fff; font-size: 1.1em; }
        .exit-fullscreen-btn { display: none; position: fixed; top: 20px; right: 20px; z-index: 99999; background: linear-gradient(135deg, #ef4444, #dc2626); color: white; padding: 15px 25px; border: 3px solid white; border-radius: 30px; font-size: 1.1em; font-weight: bold; cursor: pointer; box-shadow: 0 5px 20px rgba(0,0,0,0.5); font-family: 'Nunito', sans-serif; }
        body.fullscreen-mode .exit-fullscreen-btn { display: block !important; }
        .exit-fullscreen-btn:hover { transform: scale(1.1); }
        body.fullscreen-mode .container { max-width: 100%; height: 100vh; }
        body.fullscreen-mode .page { width: 60vw; max-width: 700px; }
        body.fullscreen-mode .page.cover-page { width: 65vw; max-width: 750px; }
        body.fullscreen-mode .story-text { font-size: 1.5em; }
        .text-display { background: linear-gradient(135deg, rgba(255,255,255,0.95), rgba(255,255,255,0.9)); padding: 15px 20px; border-radius: 12px; margin: 15px auto; max-width: 700px; text-align: center; font-size: 1.2em; line-height: 1.7; color: #1e3a5f; font-weight: 600; box-shadow: 0 4px 15px rgba(0,0,0,0.2); min-height: 50px; }
        .text-display.reading { background: linear-gradient(135deg, #dbeafe, #bfdbfe); animation: pulse 0.5s ease; }
        @keyframes pulse { 0%, 100% { transform: scale(1); } 50% { transform: scale(1.01); } }
        .zoom-level { color: #fff; font-size: 0.9em; min-width: 50px; text-align: center; font-weight: 600; }
        @media (max-width: 600px) { .title { font-size: 1.5em; } .page { width: 90vw; } .page.cover-page { width: 90vw; } .controls { padding: 8px; gap: 6px; } button { padding: 8px 14px; font-size: 0.9em; } .story-text { font-size: 1.1em; } }
    </style>
</head>

        const pages = [{"img": 0, "text": "L'Aventure Glac√©e de Naya avec Elsa", "is_cover": true}, {"img": 1, "text": "Naya adore la neige et les activit√©s hivernales ! Regarde ! De la neige magique et √©tincelante tombe tout autour d'elle !"}, {"img": 3, "text": "Wow ! C'est vraiment Elsa ! 'Bonjour Naya ! Veux-tu venir dans mon ch√¢teau de glace ?' demande Elsa avec un grand sourire."}, {"img": 5, "text": "Elsa tient la main de Naya bien fort. En haut, en haut, en haut ! Elles volent dans le ciel vers le magnifique ch√¢teau de glace d'Elsa !"}, {"img": 7, "text": "Tout est si brillant et joli ! Les murs sont faits de glace. √áa scintille comme des diamants !"}, {"img": 9, "text": "Elsa fait un super toboggan de glace ! Wheee ! Naya glisse, glisse, glisse ! 'C'√©tait trop amusant !' dit-elle en riant."}, {"img": 11, "text": "Elsa montre √† Naya comment faire des flocons de neige ! Regarde ! De jolis flocons sortent des mains de Naya ! C'est magique !"}, {"img": 13, "text": "Regarde qui est l√† ! C'est Olaf ! 'Salut ! Je suis Olaf et j'adore les c√¢lins !' Naya lui fait un gros c√¢lin tout chaud."}, {"img": 15, "text": "Elsa apprend √† Naya √† patiner sur la glace ! Elles tournent et tournent, main dans la main. C'est comme danser !"}, {"img": 17, "text": "Elsa fait √† Naya une robe sp√©ciale en glace ! Maintenant elles ressemblent toutes les deux √† des princesses des glaces ! Tournoi, tournoi, tournoi !"}, {"img": 19, "text": "Elles s'assoient ensemble et regardent le joli coucher de soleil. 'Tu es tr√®s courageuse, Naya,' dit Elsa. 'Et tu es mon amie !'"}, {"img": 21, "text": "Elsa donne √† Naya un collier flocon de neige √©tincelant qui brille. Naya le touche avec √©merveillement. Elsa la serre dans ses bras pour lui dire au revoir. Les √©toiles scintillent dehors. Le c≈ìur de Naya est rempli de joie."}, {"img": 23, "text": "Naya dit au revoir √† Elsa et Olaf. Elle se sent heureuse et courageuse. Le collier magique brille doucement alors qu'elle rentre chez elle, se souvenant de son aventure incroyable."}, {"img": 25, "text": "De retour dans son jardin, la neige magique dispara√Æt doucement, mais le collier de Naya brille toujours. Elle sait que la magie est toujours avec elle, lui rappelant l'amiti√© et le courage."}, {"img": 27, "text": "Naya sourit en tenant son collier magique flocon de neige lumineux. Elle a appris que la vraie magie se trouve dans la gentillesse et les c≈ìurs courageux. Et parfois, les r√™ves deviennent vraiment r√©alit√© ! Fin."}];
        let currentPage = 0;
        const totalPages = pages.length;
        let zoom = 1;
        let isFemaleVoice = true;
        let speechRate = 1;
        let isReading = false;
        let isFullscreen = false;
        let synth = window.speechSynthesis;
        let currentUtterance = null;

        document.addEventListener('DOMContentLoaded', () => {
            updateDisplay();
            document.addEventListener('keydown', (e) => {
                if (e.key === 'ArrowRight' || e.key === ' ') { nextPage(); e.preventDefault(); }
                else if (e.key === 'ArrowLeft') { prevPage(); e.preventDefault(); }
                else if (e.key === 'Escape') { exitFullscreen(); }
                else if ((e.key === 'f' || e.key === 'F') && !isFullscreen) { enterFullscreen(); }
            });
            document.addEventListener('fullscreenchange', handleFullscreenChange);
            document.addEventListener('webkitfullscreenchange', handleFullscreenChange);
        });

        function handleFullscreenChange() {
            const fsElement = document.fullscreenElement || document.webkitFullscreenElement;
            if (!fsElement) { isFullscreen = false; document.body.classList.remove('fullscreen-mode'); document.getElementById('fullscreenBtn').textContent = '‚õ∂ Plein √âcran'; }
        }

        function updateDisplay() {
            const page = pages[currentPage];
            const pageEl = document.getElementById('currentPage');
            document.getElementById('pageImage').src = images[page.img];
            document.getElementById('pageText').textContent = page.text;
            if (page.is_cover) { pageEl.classList.add('cover-page'); } else { pageEl.classList.remove('cover-page'); }
            if (currentPage === 0) { document.getElementById('pageIndicator').textContent = 'Couverture'; }
            else { document.getElementById('pageIndicator').textContent = `Page ${currentPage} sur ${totalPages - 1}`; }
            if (currentPage === 0) { document.getElementById('textDisplay').innerHTML = '<strong>Par EduStatic Stories Team</strong><br>Cliquez sur l\'image pour commencer l\'aventure !'; }
            else { document.getElementById('textDisplay').textContent = page.text; }
            document.getElementById('prevBtn').disabled = currentPage === 0;
            document.getElementById('nextBtn').disabled = currentPage >= totalPages - 1;
        }

        function nextPage() { if (currentPage < totalPages - 1) { currentPage++; updateDisplay(); if (isReading) readCurrentPage(); } }
        function prevPage() { if (currentPage > 0) { currentPage--; updateDisplay(); if (isReading) readCurrentPage(); } }
        function zoomIn() { if (zoom < 1.4) { zoom += 0.1; updateZoom(); } }
        function zoomOut() { if (zoom > 0.6) { zoom -= 0.1; updateZoom(); } }
        function updateZoom() { document.getElementById('book').style.transform = `scale(${zoom})`; document.getElementById('zoomLevel').textContent = Math.round(zoom * 100) + '%'; }
        function toggleVoice() { isFemaleVoice = !isFemaleVoice; document.getElementById('voiceToggle').textContent = isFemaleVoice ? 'üë© Femme' : 'üë® Homme'; }
        function updateSpeed() { speechRate = parseFloat(document.getElementById('speedSelect').value); }

        function toggleRead() {
            isReading = !isReading;
            if (isReading) { document.getElementById('readBtn').style.display = 'none'; document.getElementById('stopBtn').style.display = 'inline-block'; readCurrentPage(); }
            else { stopReading(); }
        }

        function readCurrentPage() {
            synth.cancel();
            const page = pages[currentPage];
            if (!page.text) return;
            document.getElementById('textDisplay').classList.add('reading');
            currentUtterance = new SpeechSynthesisUtterance(page.text);
            currentUtterance.lang = 'fr-FR';
            currentUtterance.rate = speechRate;
            currentUtterance.pitch = isFemaleVoice ? 1.3 : 0.9;
            const voices = synth.getVoices();
            const frenchVoices = voices.filter(v => v.lang.startsWith('fr'));
            if (frenchVoices.length > 0) { currentUtterance.voice = frenchVoices[0]; }
            currentUtterance.onend = () => {
                document.getElementById('textDisplay').classList.remove('reading');
                if (isReading && currentPage < totalPages - 1) { setTimeout(() => { nextPage(); }, 1000); }
            };
            synth.speak(currentUtterance);
        }

        function stopReading() {
            isReading = false; synth.cancel();
            document.getElementById('readBtn').style.display = 'inline-block';
            document.getElementById('stopBtn').style.display = 'none';
            document.getElementById('textDisplay').classList.remove('reading');
        }

        function enterFullscreen() {
            const elem = document.documentElement;
            if (elem.requestFullscreen) { elem.requestFullscreen(); } else if (elem.webkitRequestFullscreen) { elem.webkitRequestFullscreen(); }
            isFullscreen = true; document.body.classList.add('fullscreen-mode'); document.getElementById('fullscreenBtn').textContent = '‚õ∂ Quitter';
        }

        function exitFullscreen() {
            if (document.exitFullscreen) { document.exitFullscreen(); } else if (document.webkitExitFullscreen) { document.webkitExitFullscreen(); }
            isFullscreen = false; document.body.classList.remove('fullscreen-mode'); document.getElementById('fullscreenBtn').textContent = '‚õ∂ Plein √âcran';
        }

        if (synth.onvoiceschanged !== undefined) { synth.onvoiceschanged = () => {}; }
    </script>
